import React from 'react'

const Properties = ({ properties }) => {

  return(
    <div>
      <center><h1>Properties List</h1></center>
      {
        properties.map((property) => (
          <div class="card">
            <div class="card-body">
              <h5 class="card-title">{property.idProperty}</h5>
              <h6 class="card-subtitle mb-2 text-muted">{property.propertyStatus}</h6>
            </div>
          </div>
        ))
      }
    </div>
  )
}

export default Properties
